import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

// import components
import Test from './components/test.js';
import Home from './components/home.js'

function App() {
    return (
      <Router>
        <div className="App">
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/test" component={Test} />
          </Switch>
        </div>
      </Router>
    );
  }  

export default App;
